import React, { Component } from 'react';
import "./css/skills.css"
import Skill from "./Skill"

export default class Skills extends Component {

    render() {

        let listClass = "flex-horizontal space-between"

        return (
            <div>
            <h3>Skills</h3>
            <ul>
                <li className={`${listClass} `} ><Skill logosrc="jsLogo.svg" /> <Skill logosrc="nodeJSLogo.svg"/></li>
                <li className={listClass}><Skill logosrc="pyLogo.svg" /></li>
                <li>Python - Django Framework</li>
                <li>C# - Unity Gamedevelopment Framework</li>
            </ul>
            </div>
        )
    }
}
